import React from "react";
//import "./Score.css";

//stateless component
styles ={
  fontWeight: "bold"
};

const Score = props => (
  <div className="gameScore">
    <h3 styles={this.styles}className="score  badge-primary md-2">Your Score {props.total}</h3>
    <h3 className="status">{props.status}</h3>
  </div>
);

export default Score;
